import React, { Component } from 'react';
import TopPanel from './TopPanel';
import TopHeader from './TopHeader';
import MegaMenu from './MegaMenu';

class Navbar extends Component {
    render() {
        return (
            <React.Fragment>
               {/* <TopPanel /> */ }
                <TopHeader />
                <MegaMenu />
            </React.Fragment>
        );
    }
}

export default Navbar;
